export const initialState = {
  mainPosts: [
    {
      id: 1,
      User: {
        id: 1,
        nickname: "전세환",
      },
      content: "처 ㅅ 번째 게시글 #해시태그 #익스프래스,",
      Images: [{
        src: 'https://newsimg.hankookilbo.com/cms/articlerelease/2020/04/21/202004211422083541_3.jpg'
      },{
        src: 'https://wonderfulmind.co.kr/wp-content/uploads/2018/10/man-on-top-of-books-e1538933803436.jpg'
      },{
src: 'http://tcpschool.com/lectures/img_deeplearning_07_reinforcement.png'

      }]
    },
  ],
};

const reducer = (state = initialState, action) => {
  switch (action.type) {
    default:
      return state;
  }
};

export default reducer;
